import React from 'react';
import CSVtoJSON from 'convert-csv-to-json';
import CSV from '../data/guest_list_csv.csv';

class ReadCSV extends React.Component {


    componentDidMount() {
        const data = CSVtoJSON.getJsonFromCsv('guest_list_csv.csv');
        console.log(data);
    }

    render() {
        return <div>Read CSV</div>
    }
}

export default ReadCSV;
